<?php

class RqD_Doctor_Map{

    public function __construct() {
        add_action( 'wp_ajax_rwc_doctor_map_ajax', [$this, 'doctor_map_ajax_func'] );
        add_action( 'wp_ajax_nopriv_rwc_doctor_map_ajax', [$this, 'doctor_map_ajax_func'] );
    }

    public function doctor_map_ajax_func(){
        if ( !isset( $_REQUEST['nonce'] ) || !wp_verify_nonce( $_REQUEST['nonce'], 'ajax-nonce' ) ) {
            $error = new WP_Error( '-1', 'Permission Denied' );
            wp_send_json_error( $error );
        }

        $state = $_REQUEST['state'];
        
        // if state is empty set to first term
        if($state == null){
            $terms = get_terms( array(
                'taxonomy' => 'slp_state',
                'orderby' => 'name',
                'order' => 'ASC',
                'hide_empty' => false,
                'fields' => 'names'
            ));
            $state = $terms[0];
        }

        $args = array(
            'post_type' => 'slp_contacts',
            'posts_per_page' => -1,
            'meta_key' => 'institution_name',
            'orderby' => 'meta_value',
            'order' => 'ASC',
            'tax_query' => [
                [
                    'taxonomy' => 'slp_state',
                    'field' => 'slug',
                    'terms' => $state
                ]
            ]
        );
        $the_query = new WP_Query( $args );

        ob_start();
        if ( $the_query->have_posts() ) { ?>
            <h2><?php echo $this->convert_state($state); ?></h2>
            <div class="doctor-mortgages-block-results">
                <?php while ( $the_query->have_posts() ) { $the_query->the_post(); 
                    $fields = get_fields();
                    $institution_name = $fields['institution_name'];
                    $post_title = get_the_title();
                    ?>
                    <div class="doctor-mortgages-block-results-result">
                        <h3><?php echo $institution_name; ?></h3>
                        <a class="link" href="<?php echo get_permalink(); ?>">
                            <?php echo $post_title; ?>
                        </a>
                    </div>
                <?php } ?>
            </div>
            <?php wp_reset_postdata();
        } else {
            // no posts found
        }
        $html = ob_get_clean();
    
        if( !$state ){
            $error = new WP_Error( '-2', 'State is not defined' );
            wp_send_json_error( $error );
        }

        if( !$html ){
            $error = new WP_Error( '-3', 'No data to return' );
            wp_send_json_error( $error );
        }
        
        $data = [
            'html' => $html,
            'state' => [
                'name' => $this->convert_state( $state ),
                'abbreviation' => $state,
                'slug' => strtolower(str_replace(' ','-',$state)),
                'link' => get_term_link($state, 'slp_state')
            ]
        ];
        
        wp_send_json_success( json_encode($data) );
    
    }

    public function states_select(){
        $terms = get_terms( array(
            'taxonomy' => 'slp_state',
            'orderby' => 'name',
            'order' => 'ASC',
            'hide_empty' => false,
        ));
        ob_start();
        if($terms){ ?>
            <label for="state" class="screen-reader-text">Choose a state:</label>
            <select name="state" class="doctor-mortgages-block-select">
            <?php foreach ($terms as $term){ ?>
                    <option value="<?php echo $term->name; ?>"><?php echo $this->convert_state($term->name); ?></option>
                <?php
            } ?>
            </select>
        <?php }
        $html = ob_get_clean();
        return $html;
    }

