           array('name'=>'Guam', 'abbr'=>'GU'),
           array('name'=>'Puerto Rico', 'abbr'=>'PR')
        );
     
        $return = false;   
        $strlen = strlen($name);
     
        foreach ($states as $state) :
           if ($strlen < 2) {
              return false;
           } else if ($strlen == 2) {
              if (strtolower($state['abbr']) == strtolower($name)) {
                 $return = $state['name'];
